import React from "react";
import { TabPanel } from "@mui/base/TabPanel";

import { profileTabs } from "../../constant";
import ProfileHeader from "../../shared/ProfileHeader";

import Tabs from "@mui/material/Tabs";
import { TabsList } from "@mui/base/TabsList";
import { Tab } from "@mui/base/Tab";

//import ThreadsTab from "@/components/shared/ThreadsTab";
//import ProfileHeader from "@/components/shared/ProfileHeader";
//import { Tabs, TabsContent, TabsList, TabsTrigger } from "@/components/ui/tabs";

//import { fetchUser } from "@/lib/actions/user.actions";

function Profile() {
  //const user = await currentUser();
  //if (!user) return null;

  //const userInfo = await fetchUser(params.id);
  //if (!userInfo?.onboarded) redirect("/onboarding");

  return (
    <div classNamenameName="flex flex-1">
      <div classNamenameName="common-container">
        <div className="max-w-5xl flex-start gap-3 justify-start w-full">
          <ProfileHeader />
        </div>
        <div >
          <div>
            <select
              id="tabs"
              classNamename="bg-gray-50 border border-gray-300 text-gray-900 text-sm rounded-lg focus:ring-blue-500 focus:border-blue-500 block w-full p-2.5 dark:bg-gray-700 dark:border-gray-600 dark:placeholder-gray-400 dark:text-white dark:focus:ring-blue-500 dark:focus:border-blue-500"
            >
              <option>Posts</option>
              <option>Liked Posts</option>
            </select>
          </div>
          <ul classNamename="hidden text-sm font-medium text-center text-gray-500 rounded-lg shadow sm:flex dark:divide-gray-700 dark:text-gray-400">
            <li classNamename="w-full focus-within:z-10">
              <a
                href="#"
                classNamename="inline-block w-full p-4 text-gray-900 bg-gray-100 border-r border-gray-200 dark:border-gray-700 rounded-s-lg focus:ring-4 focus:ring-blue-300 active focus:outline-none dark:bg-gray-700 dark:text-white"
                aria-current="page"
              >
                Posts
              </a>
            </li>
            <li classNamename="w-full focus-within:z-10">
              <a
                href="#"
                classNamename="inline-block w-full p-4 bg-white border-r border-gray-200 dark:border-gray-700 hover:text-gray-700 hover:bg-gray-50 focus:ring-4 focus:ring-blue-300 focus:outline-none dark:hover:text-white dark:bg-gray-800 dark:hover:bg-gray-700"
              >
                Liked Posts
              </a>
            </li>
            
          </ul>
        </div>
      </div>
    </div>
  );
}
export default Profile;
